import { Link } from "react-router-dom";
import Input from "../components/Input";

export default function Signup(){
    return(
        <div className="container mt-5 d-flex justify-content-center" style={{zIndex:1, position:'relative'}}>
        <form className="form-group p-4 border rounded" style={{maxWidth:'400px'}}>
                <h2 className="text-center mb-4" style={{color:"#007bff"}}>Signup</h2>
                <Input type="text" label="Name" name="name" placeholder="Full Name" requried/>
                <Input type="number" label="Mobile No" name="mobile" placeholder="phone number" requried/>
                <Input type="email" label="Email" name="email" placeholder="example@gmail.com" requried/>
                <Input type="password" label="Password" name="password" placeholder="password" requried/>
                <button type="submit" className="btn-btn-primary btn-block mt-3">Signup</button>

            </form>
            <p className="mt-3">New Customer? <Link to="/login">Register here</Link></p>
        </div>
    )
}
